import React from "react";
import Allmw from "./Allmw";
import Navbar from "./Navbar";

const Cards = () => {
    const crr = fetch("https://api.themoviedb.org/3/movie/popular?api_key=c9df0bb1b55da2720c721bcb3c0b5833").then((value)=>{
        // console.log(value);
       return value.json();
    }).then((currentdata)=>{
        // console.log(currentdata.results);
       const Carr = currentdata.results;
       
    })
    const alll = crr.then((resu)=>{
        return resu.results;
    });
    console.log(`the crr is ${crr}`);
    
    const Carrs = Allmw;
    
    return (
        Carrs.map((val, index) => {
            return (<>
                <Navbar
                    key={index}
                    images = {val.link}
            title = {val.title}
            date = {val.Date}
            btao = {val.what}
            links = {val.Watch}
                />

            </>
            )
        })
    )
};

export default Cards;
